import React from "react";
import {useTrail, animated} from "react-spring";

// Import component
import Card from "./card";



function Forecast({day, temp, clouds, high, low}){
    return(
        <div className="cards-container">
            {day.map((days, index) => (
                <Card
                    day={days}
                    temp={temp[index]}
                    clouds={clouds[index]}
                    high={high[index]}
                    low={low[index]}
                />
            ))}  
        </div>
    );
};

export default Forecast;
